import styles from './Register.css'
import image from '../../assets/imgs/4-vidas.png'

const Register = () => {

  const handleSubmit = (e) => {
    e.preventDefault()

    

  }

  return (
    <div>
      <div className={styles.form}>
        <form onSubmit={handleSubmit}>

        </form>
      </div>
      <div>
        <img src={image} alt="4 vidas" />
      </div>
    </div>
  )
}

export default Register
